        "fr": {
          "title": "Making-of du Pire Gendre Leslie, l’épisode le plus fou de notre chaîne !",
          "description": "Bénéficiez de 10€ crédités dans votre cagnotte (au lieu de 3€) lors de votre inscription sur iGraal : http://bit.ly/3EHnFQA\nEt n’oubliez pas de télécharger l’extension iGraal sur votre ordi pour ne pas manquer le cashback sur vos achats en ligne : http://bit.ly/3EBIg8F\n\nPour participer à la cagnotte qui permettrait à la géniale Hélène de revoir ses amis en Algérie, c'est ici : https://lydia-app.com/pots?id=8481-pour-offrir-a-helene-un-voyage-en-algerie Même si chacun met 1 euro, c'est déjà formidable ! \n\nInsta / Tik tok / Facebook / Twitter : Greg Guillotin \nLa boutique : https://laboutiquedegregguillotin.com \n\nUn grand merci à Leslie & Abdé pour leur participation ! \n\nL'insta d'Abdé : https://www.instagram.com/abdemaziane/\nL’insta de Leslie : https://www.instagram.com/lesliezk/\n\nMerci à tous ceux qui suivent cette série depuis le début. \n\nSachez qu’on apprécie les retours positifs, mais qu’on lit également les critiques et les conseils. Sachez qu’on a beaucoup appris de nos erreurs durant ce périple. Et même après 10 ans de caméras cachées, on continue d’apprendre.\n\nAvec Greg Guillotin, David Tuil, Ted Etienne, Aina Rajemison, Abdé Maziane, Maxime Ropars, Léa Guillou, Remi Salvador, Abdé Maziane, Djimo, Seth Gueko, Agatha Rouland, Nicolas Nabis, Axel Lavigne. \n\nMonteurs : Julien Diris & David Tuil\nAssistant monteur : Martin Cirade & François Lefebvre\nSous-titrage/habillage : Agathe Soreau & Bonnie Millat \nVignette : Ynns Graphics.\nRemerciements : Jo Mordon et Webedia pour nous avoir prêté le studio (un merci particulier à Gregg et Lynda)\n\nDérusheurs : Rémi Salvador, Nicolas Nabis, Sofiane Salhi, Sami Dekoune, Guillaume Roy, François-Xavier Kerdelhué, Noah Catté, Maxime Treluyer, Axel Alinot, Camille Benier, Jules Boubounel.\n\nUn grand merci à Damien pour sa petite surprise qui nous a fait tant plaisir ! \n\nIntro Igraal\nPrésentée par Greg Guillotin\nCadreurs : Axel Lavigne & Arthur Roberdeau\nAssistante de production : Léa Guillou\nMonteurs : Rémy Kobeissi, Greg Guillotin et David Tuil \nAssistant monteur : François Lefebvre\nMerci à Mike pour ce super moment ! La bise à Anita ! Allez tcheker Mike sur insta : @anita_et_mike \n\n\nPour rappel, nous sommes filmés tous les jours dans notre quotidien au bureau et en tournage depuis 2018 en vue de réaliser des making-ofs autour des épisodes. Tout est filmé : de nos galères à nos réussites ! Nous avons donc chaque année des milliers d'heures d'images que nous condensons en épisodes de coulisses.\n\nUn grand merci à toutes les filles complices pour leur temps et leur motivation pour mener à bien ce projet ! Sans elles, il n'y aurait pas de projet. Rappelons que ne les obligeait à se lancer dans cette aventure. Seules l'expérience de vie et le fait de garder à jamais un souvenir incroyable de leurs parents les a motivées. Donc bravo à toutes nos participantes d'avoir franchi le pas et de s'être lancées corps et âme dans ce projet. Et sans notre communauté, on n'aurait aucun complice pour nous proposer des piégés. Donc tous nos projets, c'est également grâce à tous ceux qui, toute l'année, nous proposent des profils. Merci à tous de nous permettre de continuer ❤️\n\nSi vous lisez cette description jusqu’au bout, écrivez en commentaire : \"Combien y a-t-il de ventriloques muets dans le monde ? Aucun car ils sont muets. Et un ventriloque peut pas être muet. Car il est ventriloque.\""
