        "fr": {
          "title": "Pourquoi Lily a préféré James Potter 🦁 à Severus Rogue 🧪 #harrypotter #lilypotter #jamespotter",
          "description": "Pourquoi Lily a préféré James Potter 🦁 à Severus Rogue 🧪\n\n#HarryPotter #LilyEvans #JamesPotter #severusrogue  #FandomHarryPotter #harrypotterfr #harrypotterfrance #potterhead #always #rogue #potter\n\nCar oui au départ on est loin du coup de foudre du côté de Lily.\n\nElle est bien plus proche de son ami d’enfance, Severus, qui l’a initiée avant Poudlard au monde magique. \n\nBien qu’elle devienne rapidement amie avec James, elle a horreur de son comportement arrogant et brutal. Le garçon prend en effet un malin plaisir à tourmenter Rogue dès qu’il le peut.\n\nDe son côté le Serpentard n’est pas non plus blanc comme neige. Sous les attaques répétées, il essaie par tous les moyens de nuire à James et ses amis.\n\nEt il devient peu à peu très proche d’autres élèves de sa maison aux idées plus que contestables sur les moldus. Ses fréquentations le font d’ailleurs tomber dans le fanatisme d’un mage noir montant en puissance depuis quelques années… Voldemort.\n\nEt c’est là qu’est la grande différence entre Severus et James. \n\nLe 1er a petit à petit sombré dans des idées noires et malveillantes, alors que James au contraire s’est amélioré avec le temps. Devenant beaucoup plus bienveillant envers les autres et moins arrogant.\n\nFinalement, le cœur de Lily est allé à celui qui, peut-être grâce à son influence, a été capable de se remettre en question et de changer pour le mieux et non pour pire.\n\nReste à savoir si, sans les interventions de James, Severus aurait évolué différemment et si Lily et lui auraient pu avoir plus qu’une amitié. À toi de me dire ce que tu en penses."
